      const card = shuffledDeck.pop();
      dealerHand = [...dealerHand, card];
      setDealerCards(dealerHand)
       suma = calculateScore(dealerHand);
      setDealerScore(suma);
      // Actualizar la suma de la mano del crupier
      if (suma > 21) {
        pierde = true;
        setGameInProgress(false);
        setShowRestartButton(true);

