    setDealerCards([dealerCards,card]);
  }
  const handleRestart = () => {
    // Reiniciar el juego
    setGameInProgress(true);
    setShowRestartButton(false);
    setPlayerCards([]);
    setDealerCards([]);
    setHitCard([]);
